import React from "react";
import Logo from "../../assets/img/Logo.png";
import "./Menu.css";

function Menu() {
  return (
    <nav className="Menu">
      <a>
        <img className="Logo" src={Logo} alt="DMFLIX" />
      </a>
    </nav>
  );
}

export default Menu;
